import { motion } from "framer-motion";
import "./response.css";

const Response = () => {
  return (
    <motion.div
      className="container"
      initial={{ scale: 0 }}
      animate={{ rotate: 180, scale: 2 }}
      transition={{
        duration: 2,
      }}
    />
  );
};
export default Response;
